text:
- Xuất trình thẻ Thư viện tại quầy lưu hành, để cặp, túi xách đúng nơi quy định;
- Sử dụng máy tính để tra cứu tài liệu;
- Chọn sách trên giá để đọc tại chỗ hoặc mượn về nhà;
- Để sách đúng nơi quy định sau khi đọc xong;
- Sách mượn về nhà làm thủ tục tại quầy lưu hành:
  + Sách nhãn màu trắng: mỗi lần mượn 03 cuốn với thời hạn 03 tuần (có thể gia hạn thêm 01 tuần); mượn sách quá hạn sẽ bị phạt khóa thẻ theo quy định và không được mượn tài liệu tiếp theo.
  + Sách nhãn màu cam (sách hệ thống): mỗi lần mượn 05 cuốn với thời hạn 03 tuần (có thể gia hạn thêm 02 tuần); mượn sách quá hạn sẽ bị phạt khóa thẻ theo quy định và không được mượn tài liệu tiếp theo.
  + Nếu quá hạn nhiều hơn 30 ngày, Thư viện sẽ chuyển danh sách độc giả vi phạm cho Phòng Công tác Sinh viên.
